	@Test
	public void test00() {
		String sU = "263";
		String sV = "151";
		
		BigInteger u = new BigInteger(sU);
		BigInteger v = new BigInteger(sV);
		
		int k = 29;		
		
		BigInteger r = K_ary_alg.gcd(u, v, k);
		
		//assertTrue(r.equals(a.gcd(b)));
		assertEquals("1", r.toString()); 
	}
	
